import axios from "axios";
import { useState } from "react";
import toast from "react-hot-toast";
import { Link } from "react-router-dom";
import CompletingManager from "../CompletingManager";

function Details() {
  const [allDetails, setAllDetails] = useState({ managers: [], restaurants: [] });
  const [loading, setLoading] = useState(false);

  const getData = async () => {
    setLoading(true);
    try {
      const [managersResponse, restaurantsResponse] = await Promise.all([
        axios.get("http://localhost:4000/api/auth/getmanagers"),
        axios.get("http://localhost:4000/api/auth/getrestaurants"),
      ]);

      if (managersResponse.data.success && restaurantsResponse.data.success) {
        toast.success("Data fetched successfully!");
        setAllDetails({
          managers: managersResponse.data.managers || [],
          restaurants: restaurantsResponse.data.restaurants || [],
        });
      } else {
        toast.error("Failed to fetch data.");
      }
    } catch (error) {
      console.error("Error fetching data:", error);
      toast.error("Error fetching data. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen w-full bg-gradient-to-br from-gray-100 via-blue-50 to-blue-100 p-4">
      <div className="max-w-6xl mx-auto">

        <h1 className="text-3xl text-center font-bold text-gray-800 mb-8">
          Partner Portal
        </h1>

        <div className="flex justify-center gap-4 mb-8">
          <button
            onClick={getData}
            className={`px-6 py-2 rounded-full text-white font-medium transition-all duration-300 shadow-md ${
              loading
                ? "bg-gray-400 cursor-not-allowed"
                : "bg-gradient-to-r from-blue-500 to-blue-700 hover:scale-105"
            }`}
            disabled={loading}
          >
            {loading ? "Loading..." : "Fetch Data"}
          </button>

          <Link to="/admin">
            <button className="bg-gradient-to-r from-green-400 to-green-600 px-6 py-2 rounded-full text-white font-medium shadow-md transition-transform hover:scale-105">
              Admin Panel
            </button>
          </Link>
        </div>

        <CompletingManager />

        <div className="mb-10 bg-white/70 rounded-lg p-6 shadow-md">
          <h2 className="text-2xl font-semibold text-blue-700 mb-5">Manager Details</h2>
          {allDetails.managers.length > 0 ? (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
              {allDetails.managers.map((manager) => (
                <div key={manager._id} className="bg-white p-4 rounded-lg shadow border border-gray-200 hover:shadow-lg transition-all duration-300">
                  <p><strong>Name:</strong> {manager.Name}</p>
                  <p><strong>Aadhaar:</strong> {manager.AdharNumber}</p>
                  <p><strong>Phone:</strong> {manager.PhoneNumber}</p>
                  <p><strong>PAN:</strong> {manager.PanNumber}</p>
                </div>
              ))}
            </div>
          ) : (
            <p className="text-gray-600">No managers found.</p>
          )}
        </div>

        <div className="bg-white/70 rounded-lg p-6 shadow-md">
          <h2 className="text-2xl font-semibold text-blue-700 mb-5">Restaurant Details</h2>
          {allDetails.restaurants.length > 0 ? (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
              {allDetails.restaurants.map((restaurant) => (
                <div key={restaurant._id} className="bg-white p-4 rounded-lg shadow border border-gray-200 hover:shadow-lg transition-all duration-300">
                  <p><strong>Name:</strong> {restaurant.name}</p>
                  <p><strong>Address:</strong> {restaurant.address}</p>
                  <p><strong>Special For:</strong> {restaurant.specialfor}</p>
                </div>
              ))}
            </div>
          ) : (
            <p className="text-gray-600">No restaurants found.</p>
          )}
        </div>

      </div>
    </div>
  );
}

export default Details;
